%pyspark

def drawMap(lat, lng, zoom):
  return """
<link rel='stylesheet' href='http://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.3/leaflet.css'/>
<script src='http://cdnjs.cloudflare.com/ajax/libs/leaflet/0.7.3/leaflet.js'></script>
<script src='https://rawgit.com/Alex7Kom/golden-colors/master/golden-colors.js'></script>
<div id='map'></div>
<style>#map svg {width : auto; height : auto;}</style>
<script>
//hack to increase vertical mapsize
for (i = 0; i < 35; i++) $('#map').append('<br>');
//center map on Atlanta
var map = L.map('map').setView(new L.LatLng("""+str(lat)+","+str(lng)+"),"+str(zoom)+");" + """
map.addLayer(new L.TileLayer('http://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png'));

function addCircle(x, y, radius, desc, color, fillOpacity){
  L.circle(
    [x, y],
    radius,
    {color: color.toString(), fillColor: color.toString(), fillOpacity: fillOpacity}
  ).bindPopup(desc).addTo(map);
}

var colorDict = {};
</script>
"""

html = drawMap(33.7325, -84.37, 15) + "<script>"
for type in sqlContext.sql("select distinct uc2_literal as type from crimes").collect():
  html += "colorDict['"+type.type+"'] = goldenColors.getHsvGolden(0.99, 0.99);"
street_crimes = sqlContext.sql("select * from crimes where instr(lower(neighborhood), 'grant park') > 0").collect()
for crime in street_crimes:
  html += "addCircle("+crime.y+", "+crime.x+", 20, '"+crime.rpt_date+"',colorDict['"+crime.uc2_literal+"'],0.4);\n"

html += "</script>"
print '%html ' + html
